import React, { useEffect, useState } from 'react';

function App() {
  const [appointments, setAppointments] = useState([]);
  const [empData, setEmpData] = useState();


  const getAllData = async () => {
    try {
      const appointments = await fetch(
        `${process.env.REACT_APP_BASE_URL}/appointments`,
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      const res = await appointments.json();
      console.log(res);
      setEmpData(res);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    getAllData();
  }, []);
  console.log(empData);

  return (
    <div>
      <h1>Appointment Data</h1>
      {/* fablab */}
      <p>FABLAB</p>
      <table>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "FabLab") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>

      </table>

      {/* software */}
      <table>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "Software") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>

      </table>

      {/* industry 4.0 */}
      <table>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "Industry4.0") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>

      </table>
    </div>
  );
}

export default App;
